import React from 'react';
import s from './Operators.module.css'
import Item from '../Item/Item';
const Operators = (props) => {
    let operators = props.operators;
    return (
      <div className={s.item__wrapper}>
        <h3 className={s.title}>Выбирите вашего оператора</h3>
        <Item
          content={operators.name[0]}
          source={operators.source[0]}
          link={() => "/checklist/" + operators.id[0]}
        />
        <Item content="Мегафон" source="./mega.png" link="/checklist/2" />
        <Item content="Билайн" source="./bee.png" link="/checklist/3" />
      </div>
    );
        }
export default Operators;
